                security                 : trp_data['gettranslationsnonceregular'],
                language                 : language_to_query,
                original_language        : original_language, // used for trp custom ajax
                originals                : JSON.stringify( string_originals ),
                skip_machine_translation : JSON.stringify( skip_machine_translation ),
                dynamic_strings          : 'true',
                translate_numerals_opt   : translate_numerals_opt
            },
            success: function( response ) {
                if ( response === 'error' ) {
                    _this.ajax_get_translation( nodesInfo, string_originals, wp_ajax_url, skip_machine_translation );
                    console.log( 'Notice: TranslatePress trp-ajax request uses fall back to admin ajax.' );
                }else{
                    _this.update_strings( response, nodesInfo );
                }
            },
            error: function( errorThrown ){
                if ( url == custom_ajax_url && custom_ajax_url != wp_ajax_url ){
                    _this.ajax_get_translation( nodesInfo, string_originals, wp_ajax_url, skip_machine_translation );
                    console.log( 'Notice: TranslatePress trp-ajax request uses fall back to admin ajax.' );
                }else{
                    _this.update_strings( null, nodesInfo );
                    console.log( 'TranslatePress AJAX Request Error' );
                }
            }
        });
    };

    /**
     * Return given text converted to html.
     *
     * Useful for decoding special characters into displayable form.
     *
     * @param html
     * @returns {*}
     */
    this.decode_html = function( html ) {
        var txt = document.createElement( "textarea" );
        txt.innerHTML = html;
        return txt.value;
    };

    /**
     * Replace original strings with translations if found.
     */
    this.update_strings = function( response, nodesInfo ) {
        _this.pause_observer();
        if ( response != null && response.length > 0 ){
            var newEntries = [];
            for (var j = 0 ; j < nodesInfo.length; j++){
                var nodeInfo = nodesInfo[j];
                var translation_found = false;
                var initial_value = nodeInfo.original;
                for( var i = 0; i <  response.length; i++ ) {
                    var response_string = response[i].translationsArray[language_to_query];
                    if (response[i].original.trim() == nodeInfo.original.trim()) {
                        // The nodeInfo can contain duplicates and response cannot. We need duplicates to refer to different jQuery objects where the same string appears in different places on the page.
                        var entry = response[i]
                        entry.selector = 'data-trp-translate-id'
                        entry.attribute = ''
                        newEntries.push( entry )
                        if ( _this.is_editor ) {
                            var jquery_object;
                            var trp_translate_id = 'data-trp-translate-id'
                            var trp_node_group = 'data-trp-node-group'
                            if ( nodeInfo.attribute ) {
                                jquery_object = jQuery(nodeInfo.node)
                                trp_translate_id = trp_translate_id + '-' + nodeInfo.attribute
                                trp_node_group = trp_node_group + '-' + nodeInfo.attribute
                            }else{
                                jquery_object = jQuery(nodeInfo.node).parent('translate-press');
                            }
                            jquery_object.attr( trp_translate_id, response[i].dbID );
                            jquery_object.attr( trp_node_group, response[i].group );
                        }

                        if (response_string.translated != '' && language_to_query == current_language ) {
                            var text_to_set = _this.decode_html( initial_value.replace(initial_value.trim(), response_string.translated));
                            if ( nodeInfo.attribute ){
                                nodeInfo.node.setAttribute( nodeInfo.attribute, text_to_set )
                                if ( nodeInfo.attribute == 'src' ){
                                    nodeInfo.node.setAttribute( 'srcset', '' )
                                    nodeInfo.node.setAttribute( 'data-src', text_to_set )
                                }
                            }else {
                                nodeInfo.node.textContent = text_to_set;
                            }
                            translation_found = true;
                        }
                        break;
                    }
                }

                already_detected[ initial_value ] = (initial_value in already_detected ) ? already_detected[ initial_value ] + 1 : 0
                if ( ! translation_found ){
                    if ( nodeInfo.attribute ){
                        if ( nodeInfo.attribute != 'src' ) {
                            nodeInfo.node.setAttribute(nodeInfo.attribute, initial_value)
                        }
                    }else {
                        nodeInfo.node.textContent = initial_value;
                    }
                }

            }
            // this should always be outside the for loop
            if ( _this.is_editor ) {
                window.parent.dispatchEvent( new Event( 'trp_iframe_page_updated' ) );
                window.dispatchEvent( new Event( 'trp_iframe_page_updated' ) );
            }

        }else{
            for (var j = 0 ; j < nodesInfo.length; j++){
                if ( nodesInfo[j].attribute ){
                    if ( nodesInfo[j].attribute != 'src' ) {
                        nodesInfo[j].node.setAttribute(nodesInfo[j].attribute, nodesInfo[j].original)
                    }
                }else {
                    nodesInfo[j].node.textContent = nodesInfo[j].original;
                }
                already_detected[ nodesInfo[j].original ] = (nodesInfo[j].original in already_detected ) ? already_detected[ nodesInfo[j].original ] + 1 : 0
            }
        }
        _this.resume_observer();
    };

    /*
     * Separated from the detect_new_strings function to allow disconnecting observer.
     */
    this.detect_new_strings_callback = function( mutations ){
        // calling disconnect directly instead of calling pause_observer because we don't need to takeRecords() (called from pause_observer) because we would duplicate mutations
        observer.disconnect()
        _this.detect_new_strings( mutations );
        _this.resume_observer();
    }

    /**
     * Detect and remember added strings.
     */
    this.detect_new_strings = function( mutations ){
        var string_originals = [];
        var nodesInfo = [];
        var skip_machine_translation = [];
        var translateable;
        mutations.forEach( function (mutation) {
            for (var i = 0; i < mutation.addedNodes.length; i++) {
                var node = mutation.addedNodes[i]
                /* if it is an anchor add the trp-edit-translation=preview parameter to it */
                if ( _this.is_editor ){
                    var anchor_tags = jQuery(node).find('a')
                    if ( typeof anchor_tags.context !== 'undefined' )
                        anchor_tags.context.href = _this.update_query_string('trp-edit-translation', 'preview', anchor_tags.context.href);
                }

                if ( _this.skip_string(node) ){
                    continue;
                }

                // Search for innertext modifications or newly added nodes with innertext
                translateable = _this.get_translateable_textcontent( node )
                string_originals = string_originals.concat( translateable.string_originals );
                nodesInfo = nodesInfo.concat( translateable.nodesInfo );
                skip_machine_translation = skip_machine_translation.concat( translateable.skip_machine_translation );

                // Search for text inside attributes of newly added nodes
                translateable = _this.get_translateable_attributes( node )
                string_originals = string_originals.concat( translateable.string_originals );
                nodesInfo = nodesInfo.concat( translateable.nodesInfo );
                skip_machine_translation = skip_machine_translation.concat( translateable.skip_machine_translation );
            }

            if ( mutation.attributeName ){
                if ( ! _this.in_array( mutation.attributeName, trp_data.trp_attributes_accessors ) ){
                    return
                }
                if ( _this.skip_string_attribute( mutation.target, mutation.attributeName ) || _this.skip_string(mutation.target) ){
                    return
                }

                // Search for modified text inside attributes of existing nodes
                translateable = _this.get_translateable_attributes( mutation.target )
                string_originals = string_originals.concat( translateable.string_originals );
                nodesInfo = nodesInfo.concat( translateable.nodesInfo );
                skip_machine_translation = skip_machine_translation.concat( translateable.skip_machine_translation );
            }
        });
        if ( nodesInfo.length > 0 ) {
            var ajax_url_to_call = (_this.is_editor) ? wp_ajax_url : custom_ajax_url;
            _this.ajax_get_translation( nodesInfo, string_originals, ajax_url_to_call, skip_machine_translation );
        }
    };

    this.skip_string = function(node){
        // skip nodes containing these attributes
        var selectors = trp_data.trp_skip_selectors;
        for (var i = 0; i < selectors.length ; i++ ){
            if ( jQuery(node).closest( selectors[ i ] ).length > 0 ){
                return true;
            }
        }
        return false;
    };

    this.skip_string_from_auto_translation = function(node){
        // nodes containing these attributes will not be automatically translated
        var selectors = trp_data.trp_no_auto_translation_selectors;
        for (var i = 0; i < selectors.length ; i++ ){
            if ( jQuery(node).closest( selectors[ i ] ).length > 0 ){
                return true;
            }
        }
        return false;
    };

    this.contains_substring_that_needs_skipped = function ( string, attribute ){
        for (var attribute_to_skip in trp_data.skip_strings_from_dynamic_translation_for_substrings ){
            if (trp_data.skip_strings_from_dynamic_translation_for_substrings.hasOwnProperty(attribute_to_skip) && attribute === attribute_to_skip) {
                for ( var i = 0 ; i < trp_data.skip_strings_from_dynamic_translation_for_substrings[attribute_to_skip].length; i++ ){
                    if ( string.indexOf(trp_data.skip_strings_from_dynamic_translation_for_substrings[attribute_to_skip][i]) !== -1  ){
                        return true
                    }
                }
            }
        }
        return false
    };

    /*
     * Skip string based on original string text
     */
    this.skip_string_original = function ( string, attribute ){
        return (
            ( already_detected[string] > duplicate_detections_allowed ) ||
            _this.in_array( string, trp_data.skip_strings_from_dynamic_translation ) ||
            _this.contains_substring_that_needs_skipped( string, attribute)
        )
    }

    this.skip_string_attribute = function(node, attribute){
        // skip nodes containing these attributes
        var selectors = trp_data.trp_base_selectors;
        for (var i = 0; i < selectors.length ; i++ ){
            if ( typeof jQuery(node).attr( selectors[ i ] + '-' + attribute ) !== 'undefined' ){
                return true;
            }
        }
        return false;
    };

    this.in_array = function (needle, array ) {
        var i
        var length = array.length
        for( i = length - 1; i >= 0; i-- ){
            if ( array[i] === needle ){
                return true
            }
        }
        return false
    }

    this.get_translateable_textcontent = function( node ){
        var string_originals = [];
        var nodesInfo = [];
        var skip_machine_translation = []
        if ( node.textContent && _this.trim( node.textContent.trim(), _this.except_characters ) != '' ) {

            var direct_string = get_string_from_node( node );
            if ( direct_string ) {
                // a text without HTML was added
                if ( _this.trim( direct_string.textContent, _this.except_characters ) != '' ) {
                    var extracted_original = _this.trim(direct_string.textContent, trim_characters);
                    if ( ! _this.skip_string_original( extracted_original, false )) {
                        nodesInfo.push({node: node, original: extracted_original, attribute: ''});
                        string_originals.push(extracted_original)
                        if ( _this.skip_string_from_auto_translation(node)){
                            skip_machine_translation.push( extracted_original )
                        }

                        direct_string.textContent = '';
                        if (_this.is_editor) {
                            jQuery(node).wrap('<translate-press></translate-press>');
                        }
                    }
                }
            }else{
                // node contains HTML
                var all_nodes = jQuery( node ).find( '*').addBack();
                var all_strings = all_nodes.contents().filter(function(){
                    if( this.nodeType === 3 && /\S/.test(this.nodeValue) ){
                        if ( ! _this.skip_string(this) ){
                            return this;
                        }
                    }});
                if ( _this.is_editor ) {
                    all_strings.wrap('<translate-press></translate-press>');
                }
                var all_strings_length = all_strings.length;
                for (var j = 0; j < all_strings_length; j++ ) {
                    if ( _this.trim( all_strings[j].textContent, _this.except_characters ) != '' ) {
                        if ( ! _this.skip_string_original( all_strings[j].textContent, false )) {
                            nodesInfo.push({node: all_strings[j], original: all_strings[j].textContent, attribute: ''});
                            string_originals.push(all_strings[j].textContent)
                            if ( _this.skip_string_from_auto_translation(all_strings[j])){
                                skip_machine_translation.push( all_strings[j].textContent )
                            }
                            if (trp_data ['showdynamiccontentbeforetranslation'] == false) {
                                all_strings[j].textContent = '';
                            }
                        }
                    }
                }
            }
        }
        return { 'string_originals': string_originals, 'nodesInfo': nodesInfo, 'skip_machine_translation': skip_machine_translation  };
    }

    this.get_translateable_attributes = function ( node ) {
        var nodesInfo = []
        var string_originals = []
        var skip_attr_machine_translation = [ 'href', 'src' ]
        var skip_machine_translation = []
        for (var trp_attribute_key in trp_data.trp_attributes_selectors) {
            if (trp_data.trp_attributes_selectors.hasOwnProperty(trp_attribute_key)) {
                var attribute_selector_item = trp_data.trp_attributes_selectors[trp_attribute_key]
                if ( typeof attribute_selector_item['selector'] !== 'undefined' ){
                    var all_nodes = jQuery( node ).find( attribute_selector_item.selector ).addBack( attribute_selector_item.selector )

                    var all_nodes_length = all_nodes.length
                    for (var j = 0; j < all_nodes_length; j++ ) {
                        if ( _this.skip_string( all_nodes[j] ) || _this.skip_string_attribute( all_nodes[j], attribute_selector_item.accessor ) ){
                            continue;
                        }

                        var attribute_content = all_nodes[j].getAttribute( attribute_selector_item.accessor )
                        if ( _this.skip_string_original( attribute_content, attribute_selector_item.accessor )){
                            continue;
                        }
                        if ( attribute_content && _this.trim( attribute_content.trim(), _this.except_characters ) != '' ) {
                            nodesInfo.push({node: all_nodes[j], original: attribute_content, attribute: attribute_selector_item.accessor });
                            string_originals.push( attribute_content )
                            if ( trp_data ['showdynamiccontentbeforetranslation'] == false && ( attribute_selector_item.accessor != 'src' ) && ( attribute_selector_item.accessor != 'href' ) ) {
                                all_nodes[j].setAttribute( attribute_selector_item.accessor, '' );
                            }

                            if ( _this.skip_string_from_auto_translation(all_nodes[j])){
                                skip_machine_translation.push( attribute_content )
                            }else{
                                for ( var s = 0; s < skip_attr_machine_translation.length; s++ ) {
                                    if ( attribute_selector_item.accessor === skip_attr_machine_translation[ s ] ){
                                        skip_machine_translation.push( attribute_content )
                                        break
                                    }
                                }
                            }
                        }
                    }
                }
            }
        }
        return { 'string_originals': string_originals, 'nodesInfo': nodesInfo, 'skip_machine_translation': skip_machine_translation };
    }

    function get_string_from_node( node ){
        if( node.nodeType === 3 && /\S/.test(node.nodeValue) ){
            if ( ! _this.skip_string(node) ){
                return node;
            }
        }
    }

    // cleans the gettext wrappers
    this.cleanup_gettext_wrapper = function(){
        jQuery('trp-gettext').contents().unwrap();
    };

    /**
     * Update url with query string.
     *
     */
    this.update_query_string = function(key, value, url) {
        if (!url) return url;
        if ( url.startsWith('#') ){
            return url;
        }
        var re = new RegExp("([?&])" + key + "=.*?(&|#|$)(.*)", "gi"),
            hash;

        if (re.test(url)) {
            if (typeof value !== 'undefined' && value !== null)
                return url.replace(re, '$1' + key + "=" + value + '$2$3');
            else {
                hash = url.split('#');
                url = hash[0].replace(re, '$1$3').replace(/(&|\?)$/, '');
                if (typeof hash[1] !== 'undefined' && hash[1] !== null)
                    url += '#' + hash[1];
                return url;
            }
        }
        else {
            if (typeof value !== 'undefined' && value !== null ) {
                var separator = url.indexOf('?') !== -1 ? '&' : '?';
                hash = url.split('#');
                url = hash[0] + separator + key + '=' + value;
                if (typeof hash[1] !== 'undefined' && hash[1] !== null)
                    url += '#' + hash[1];
                return url;
            }
            else
                return url;
        }
    };

    /**
     * Initialize and configure observer.
     */
    this.initialize = function() {
        this.is_editor = (typeof window.parent.tpEditorApp !== 'undefined' )
        if ( this.is_editor ) {
            trp_data['gettranslationsnonceregular'] = window.parent.trp_dynamic_nonce;
        }

        current_language = trp_data.trp_current_language;
        original_language = trp_data.trp_original_language;
        language_to_query = trp_data.trp_language_to_query;
        translate_numerals_opt = trp_data.trp_translate_numerals_opt;

        if ( typeof translate_numerals_opt !== "undefined" && translate_numerals_opt !== '' && translate_numerals_opt === "yes") {
            _this.except_characters = " \t\n\r  �.,/`~!@#$€£%^&*():;-_=+[]{}\\|?/<>'";
        }

        // create an observer instance
        observer = new MutationObserver( _this.detect_new_strings_callback );

        _this.resume_observer();

        jQuery( document ).ajaxComplete(function( event, request, settings ) {
            if( typeof window.parent.jQuery !== "undefined" && window.parent.jQuery('#trp-preview-iframe').length != 0 ) {
                var settingsdata = "" + settings.data;
                if( typeof settings.data == 'undefined' || jQuery.isEmptyObject( settings.data ) || settingsdata.indexOf('action=trp_') === -1 ) {
                    window.parent.dispatchEvent( new Event( 'trp_iframe_page_updated' ) );
                }
            }
        });

        //try a final attempt at cleaning the gettext wrappers
        _this.cleanup_gettext_wrapper();
    };

    /**
     * Resume observing new strings added.
     */
    this.resume_observer = function(){
        if ( language_to_query === '' ) {
            // No translation languages are set other than default language
            return;
        }
        observer.observe(document.body, observerConfig);
    };

    /**
     * Pause observing new strings added.
     */
    this.pause_observer = function(){
        /*
        Disconnect will delete the existing mutations detected prior to being passed to callback function.
        So we are calling takeRecords to save them first, disconnect, then detect the strings
        Disconnect happens before detect_new_strings to avoid detecting mutations from within detect new strings functions
         */
        if ( language_to_query === '' ) {
            // No translation languages are set other than default language
            return;
        }
        var mutations = observer.takeRecords()
        observer.disconnect()
        if ( mutations.length > 0 ) {
            _this.detect_new_strings(mutations)
        }

    };

    this.trim = function (str, charlist) {
        //  discuss at: http://locutus.io/php/trim/
        // original by: Kevin van Zonneveld (http://kvz.io)
        // improved by: mdsjack (http://www.mdsjack.bo.it)
        // improved by: Alexander Ermolaev (http://snippets.dzone.com/user/AlexanderErmolaev)
        // improved by: Kevin van Zonneveld (http://kvz.io)
        // improved by: Steven Levithan (http://blog.stevenlevithan.com)
        // improved by: Jack
        //    input by: Erkekjetter
        //    input by: DxGx
        // bugfixed by: Onno Marsman (https://twitter.com/onnomarsman)
        //   example 1: trim('    Kevin van Zonneveld    ')
        //   returns 1: 'Kevin van Zonneveld'
        //   example 2: trim('Hello World', 'Hdle')
        //   returns 2: 'o Wor'
        //   example 3: trim(16, 1)
        //   returns 3: '6'
        var whitespace = [
            ' ',
            '\n',
            '\r',
            '\t',
            '\f',
            '\x0b',
            '\xa0',
            '\u2000',
            '\u2001',
            '\u2002',
            '\u2003',
            '\u2004',
            '\u2005',
            '\u2006',
            '\u2007',
            '\u2008',
            '\u2009',
            '\u200a',
            '\u200b',
            '\u2028',
            '\u2029',
            '\u3000'
        ].join('');
        var l = 0;
        var i = 0;
        str += '';
        if (charlist) {
            whitespace += (charlist + '').replace(/([[\]().?/*{}+$^:])/g, '$1');
        }
        l = str.length;
        for (i = 0; i < l; i++) {
            if (whitespace.indexOf(str.charAt(i)) === -1) {
                str = str.substring(i);
                break;
            }
        }
        l = str.length;
        for (i = l - 1; i >= 0; i--) {
            if (whitespace.indexOf(str.charAt(i)) === -1) {
                str = str.substring(0, i + 1);
                break;
            }
        }
        return whitespace.indexOf(str.charAt(0)) === -1 ? str : '';
    };

    _this.initialize();
}

var trpTranslator;
var current_language;
var original_language;

function trp_get_IE_version() {
    var sAgent = window.navigator.userAgent;
    var Idx = sAgent.indexOf("MSIE");

    // If IE, return version number.
    if (Idx > 0)
        return parseInt(sAgent.substring(Idx+ 5, sAgent.indexOf(".", Idx)));

    // If IE 11 then look for Updated user agent string.
    else if (!!navigator.userAgent.match(/Trident\/7\./))
        return 11;
    else
        return 0; //It is not IE
}

function trp_allow_detect_dom_changes_to_run(){
    var IE_version = trp_get_IE_version();
    if ( IE_version != 0 && IE_version <= 11 ){
        return false;
    }
    return true;
}


// Initialize the Translate Press Editor when the script loads
if ( trp_allow_detect_dom_changes_to_run() ) {
    trpTranslator = new TRP_Translator();
}

/*
 * Script used in Settings-> Add-ons Page
 *
 * It sends request to install and activate recommended plugins
 */

function TRP_Plugins_Installer() {
    var _this = this

    function ajax_request( pluginSlug, element ) {
        var request = new XMLHttpRequest()
        request.open( 'POST', trp_addons_localized[ 'admin_ajax_url' ], true )
        request.setRequestHeader('Content-Type', 'application/x-www-form-urlencoded; charset=UTF-8')
        request.onload = function () {
            if ( this.status >= 200 && this.status < 400 ){
                var data = JSON.parse( this.response )
                element.innerHTML = data
                element.setAttribute('disabled', true )
                location.reload();
            }
        }

        request.send(  encodeURI('security=' + trp_addons_localized[ 'nonce' ] + '&action=trp_install_plugins&plugin_slug=' + pluginSlug))
    }

    function triggerUpdate( event ) {
        var pluginSlug      = event.target.getAttribute( 'data-trp-plugin-slug' )
        var actionPerformed = event.target.getAttribute( 'data-trp-action-performed' )

        event.target.removeEventListener( 'click', triggerUpdate )
        event.target.innerHTML = actionPerformed

        ajax_request( pluginSlug, event.target )

    }

    function init( selector ) {
        document.querySelectorAll( selector ).forEach( item => {
            item.addEventListener( 'click', triggerUpdate )
        } )
    }

    return {
        init : init
    }
}

var trp_plugin_installer = new TRP_Plugins_Installer()
trp_plugin_installer.init( '.trp-install-and-activate' )

class BaseSwitcher {
    constructor(rootEl) {
        this.root = rootEl;
        this.list = rootEl?.querySelector('.trp-switcher-dropdown-list') || null;
        this.isOpen = false;
        this._pendingFocusOnOpen = false;
        if (!this.root || !this.list) return;

        if (!this.list.id) {
            this.list.id = `trp-list-${Math.random().toString(36).slice(2, 9)}`;
        }

        // Single transitionend handler to drop .is-transitioning and finalize hidden/inert
        this._onTe = (e) => {
            if (e.target !== this.list || e.propertyName !== 'max-height') return;

            this.root.classList.remove('is-transitioning');

            if (!this.isOpen) {
                this.list.hidden = true;
                this.list.setAttribute('inert', '');
            } else if (this._pendingFocusOnOpen) {
                this._pendingFocusOnOpen = false;
                const first = this.list.querySelector(
                    '[role="option"], a, button, [tabindex]:not([tabindex="-1"])'
                );
                first?.focus?.({ preventScroll: true });
            }
        };
        this.list.addEventListener('transitionend', this._onTe);

        this.collapse();
        this.setAutoWidth();

        this.bindKeyboard(this.root);
    }

    collapse() {
        this.list.hidden = true;
        this.list.setAttribute('inert', '');
        this.setExpanded(false);
        this.root.classList.remove('is-transitioning');
    }

    /**
     * If width is set to auto, fix it to the calculated width + 20px
     * We do this in order to avoid width shift on hover
     * */
    setAutoWidth() {
        const bonusWidth = 20;

        const cs = getComputedStyle(this.root);
        const declaredWidth = cs.getPropertyValue('--switcher-width').trim();

        if (declaredWidth === 'auto') {
            const initialWidth = this.root.getBoundingClientRect().width;

            this.root.style.setProperty('--switcher-width', (initialWidth + bonusWidth) + 'px');
        }
    }

    setExpanded(open) {
        const val = String(!!open);
        this.root.setAttribute('aria-expanded', val);
        this.root.classList.toggle('is-open', !!open);
    }

    setOpen(open, { source = null } = {}) {
        if (!this.root || !this.list || open === this.isOpen) return;

        // Honor reduced motion: skip the transition entirely (still class-driven)
        const prefersReduced = window.matchMedia?.('(prefers-reduced-motion: reduce)')?.matches;

        this.isOpen = open;

        if (open) {
            // Prepare: must be visible for CSS transition to run
            this.list.hidden = false;
            this.list.removeAttribute('inert');

            if (prefersReduced) {
                this.root.classList.remove('is-transitioning');
                this.setExpanded(true);
            } else {
                this.root.classList.add('is-transitioning');
                // Next frame so the browser registers the pre-open (max-height:0) state
                requestAnimationFrame(() => this.setExpanded(true));
            }

            // keyboard open should move focus after transition completes
            this._pendingFocusOnOpen = (source?.type === 'keydown');

        } else {
            if (prefersReduced) {
                this.setExpanded(false);
                this.list.hidden = true;
                this.list.setAttribute('inert', '');
                this.root.classList.remove('is-transitioning');
            } else {
                this.root.classList.add('is-transitioning');
                // Removing is-open triggers CSS max-height → 0 animation
                this.setExpanded(false);
            }
        }
    }

    bindKeyboard(target) {
        target.addEventListener('keydown', (e) => {
            if (e.key === 'Enter' || e.key === ' ') {
                e.preventDefault();
                this.setOpen(!this.isOpen, { source: e });
            }
            if (e.key === 'Escape') {
                this.setOpen(false, { source: e });
                target.focus?.();
            }
        });
    }
}

class ShortcodeSwitcher extends BaseSwitcher {
    constructor(wrapper) {
        const overlay =
                  wrapper.querySelector('.trp-language-switcher.trp-shortcode-overlay')
                  || [...wrapper.querySelectorAll('.trp-language-switcher')]
                      .find(el => el.classList.contains('trp-shortcode-overlay'));

        if (!overlay) {
            console.warn('[TRP] Shortcode overlay not found inside wrapper:', wrapper);
            return;
        }

        // Overlay must be interactable; ensure no accidental hidden/inert from server
        overlay.hidden = false;
        overlay.removeAttribute('hidden');
        overlay.removeAttribute('inert');
        if ('inert' in overlay) overlay.inert = false;

        super(overlay);
        if (!this.root || !this.list) return;

        // ARIA on overlay (focusable container)
        this.root.setAttribute('role', 'listbox');
        this.root.setAttribute('aria-haspopup', 'listbox');
        this.root.setAttribute('aria-controls', this.list.id);
        if (!this.root.hasAttribute('tabindex')) this.root.setAttribute('tabindex', '0');

        const isClickMode =
                  this.root.classList.contains('trp-open-on-click') ||
                  wrapper.dataset.openMode === 'click' ||
                  wrapper.classList.contains('trp-open-on-click');

        if (isClickMode) {
            // Click anywhere on overlay EXCEPT inside the list
            this.root.addEventListener('click', (e) => {
                const inList = e.target.closest('.trp-switcher-dropdown-list');
                if (!inList) {
                    e.preventDefault();
                    e.stopPropagation();
                    this.setOpen(!this.isOpen, { source: e });
                }
            }, true);

            // Outside click closes
            this.onDocClick = (evt) => {
                if (!wrapper.contains(evt.target)) this.setOpen(false, { source: evt });
            };
            document.addEventListener('click', this.onDocClick, true);

            // Focus leaving wrapper closes
            wrapper.addEventListener('focusout', () => {
                setTimeout(() => {
                    if (!wrapper.contains(document.activeElement)) {
                        this.setOpen(false, { source: 'keyboard' });
                    }
                }, 0);
            });
        } else {
            // Hover mode on overlay
            this.root.addEventListener('mouseenter', (e) => this.setOpen(true,  { source: e }));
            this.root.addEventListener('mouseleave', (e) => this.setOpen(false, { source: e }));
        }
    }
}

class FloaterSwitcher extends BaseSwitcher {
    constructor(el) {
        if (el.classList.contains('trp-opposite-language')) return;
        super(el);

        el.addEventListener('mouseenter', (e) => this.setOpen(true,  { source: e }));
        el.addEventListener('mouseleave', (e) => this.setOpen(false, { source: e }));

        this.onDocClick = (evt) => { if (!el.contains(evt.target)) this.setOpen(false, { source: evt }); };
        document.addEventListener('click', this.onDocClick, true);
    }
}

